import React from "react";
import { Card, withStyles } from "@material-ui/core";

const styles = {
  card: {
    width: 175,
    height: 250,
    backgroundColor: "grey"
  }
};

export default withStyles(styles)(({ classes }) => {
  return (
    <Card className={classes.card}>
      <CardHeader title="X-Caliber" />
    </Card>
  );
});
